import React from "react";
import { Container } from "react-bootstrap";
import Grid from '@mui/material/Grid';
import BackHomeButt from "./BackHomeButt";
import ProjectCard from "./ProjectCard"
import projectData from "../content/projects.json"

import { styled } from '@mui/material/styles';
import Paper from '@mui/material/Paper';


const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }));

function ProjectsOverview() {
    return (
        <Container className="project-overview-container">
            <BackHomeButt />


            <Grid container spacing={3}>
                <Grid item xs={4}>
                    <Item>xs=4</Item>
                </Grid>
                <Grid item xs={4}>
                    <Item>xs=4</Item>
                </Grid>
                <Grid item xs={4}>
                    <Item>xs=4</Item>
                </Grid>
                <Grid item xs={8}>
                    <Item>xs=8</Item>
                </Grid>
            </Grid>


            <Container className="project-cards-container">

                {projectData.list_of_talks.map((project, index) => (
                    <ProjectCard
                        project_name={project.project_title}
                        description={project.project_description}
                        technologies={project.technologies}
                        link={project.link}
                        link_description={project.link_description}
                    />
                ))}

            </Container>
        </Container>
    )
}

export default ProjectsOverview
